import React from 'react';
import SongList from './SongList';
// import {selectedSong} from '../actions';

class App extends React.Component{
	render() {
		return (
			<div className="ui container">
				<div className="column eight wide">
					<SongList />
				</div>
			</div>
		);
	}
}

export default App;
